    /**
     *  HEAP SORT
     *  @author: https://www.geeksforgeeks.org/heap-sort/
     */
    fun h_sort_double(arr:DoubleArray) {
      val n = arr.size

      // Build heap (rearrange array)
      for (i in n / 2 - 1 downTo 0)
        heapify_double(arr, n, i)

      // One by one extract an element from heap
      for (i in n - 1 downTo 1) {
        // Move current root to end
        val temp = arr[0]
        arr[0] = arr[i]
        arr[i] = temp

        // call max heapify on the reduced heap
        heapify_double(arr, i, 0)
      }
    }
    fun h_sort_int(arr:IntArray) {
      val n = arr.size

      // Build heap (rearrange array)
      for (i in n / 2 - 1 downTo 0)
        heapify_int(arr, n, i)

      // One by one extract an element from heap
      for (i in n - 1 downTo 1) {
        // Move current root to end
        val temp = arr[0]
        arr[0] = arr[i]
        arr[i] = temp

        // call max heapify on the reduced heap
        heapify_int(arr, i, 0)
      }
    }

    // To heapify a subtree rooted with node i which is
    // an index in arr[]. n is size of heap
    fun heapify_double(arr:DoubleArray, n:Int, i:Int) {
      var largest = i // Initialize largest as root
      val l = 2 * i + 1 // left = 2*i + 1
      val r = 2 * i + 2 // right = 2*i + 2

      // If left child is larger than root
      if (l < n && arr[l] > arr[largest])
        largest = l

      // If right child is larger than largest so far
      if (r < n && arr[r] > arr[largest])
        largest = r

      // If largest is not root
      if (largest != i) {
        val swap = arr[i]
        arr[i] = arr[largest]
        arr[largest] = swap

        // Recursively heapify the affected sub-tree
        heapify_double(arr, n, largest)
      }
    }

    // To heapify a subtree rooted with node i which is
    // an index in arr[]. n is size of heap
    fun heapify_int(arr:IntArray, n:Int, i:Int) {
      var largest = i // Initialize largest as root
      val l = 2 * i + 1 // left = 2*i + 1
      val r = 2 * i + 2 // right = 2*i + 2

      // If left child is larger than root
      if (l < n && arr[l] > arr[largest])
        largest = l

      // If right child is larger than largest so far
      if (r < n && arr[r] > arr[largest])
        largest = r

      // If largest is not root
      if (largest != i) {
        val swap = arr[i]
        arr[i] = arr[largest]
        arr[largest] = swap

        // Recursively heapify the affected sub-tree
        heapify_int(arr, n, largest)
      }
    }

