    /**
     *  QUICK SORT
     *  @author: https://www.geeksforgeeks.org/quick-sort/
     */
    
    /* This function takes last element as pivot, places the pivot element at its correct position in sorted
       array, and places all smaller (smaller than pivot) to left of pivot and all greater elements to right of pivot */
    fun partition_double(arr:DoubleArray, low:Int, high:Int):Int {
      val pivot = arr[high]
      var i = (low - 1) // index of smaller element

      for (j in low until high) {
        // If current element is smaller than the pivot
        if (arr[j] < pivot) {
          i++

          // swap arr[i] and arr[j]
          val temp = arr[i]
          arr[i] = arr[j]
          arr[j] = temp
        }
      }
      return i + 1
    }

    fun partition_int(arr:IntArray, low:Int, high:Int):Int {
      val pivot = arr[high]
      var i = (low - 1) // index of smaller element

      for (j in low until high) {
        // If current element is smaller than the pivot
        if (arr[j] < pivot) {
          i++

          // swap arr[i] and arr[j]
          val temp = arr[i]
          arr[i] = arr[j]
          arr[j] = temp
        }
      }

      // swap arr[i+1] and arr[high] (or pivot)
      val temp = arr[i + 1]
      arr[i + 1] = arr[high]
      arr[high] = temp

      return i + 1
    }

    /* The main function that implements QuickSort()
        arr[] --> Array to be sorted,
        low --> Starting index,
        high --> Ending index */
    fun startQuickSortDouble(arr:DoubleArray, low:Int, high:Int) {
      if (low < high) {
        /* pi is partitioning index, arr[pi] is now at right place */
        val pi = partition_double(arr, low, high)

        // Recursively sort elements before partition and after partition
        startQuickSortDouble(arr, low, pi - 1)
        startQuickSortDouble(arr, pi + 1, high)
      }
    }
    fun startQuickSortInt(arr:IntArray, low:Int, high:Int) {
      if (low < high) {
        /* pi is partitioning index, arr[pi] is now at right place */
        val pi = partition_int(arr, low, high)

        // Recursively sort elements before partition and after partition
        startQuickSortInt(arr, low, pi - 1)
        startQuickSortInt(arr, pi + 1, high)
      }
    }

